import React from "react";

function star({ value, req }) {
  return (
    <span>
      <i
        class={
          value >= req
            ? "fa-solid fa-star"
            : value >= req
            ? "fa-regular fa-star"
            : "fa-regular fa-star-half-stroke"
        }
      ></i>
    </span>
  );
}

const Rating = ({ value, text }) => {
  const ratings = [0, 1, 2, 3, 4];
  ratings.map((x) => {
    star((value = { value }), (req = 0));
  });
  return (
    <div className="rating">
      <span>
        <i
          class={
            value >= 1
              ? "fa-solid fa-star"
              : value >= 0.5
              ? "fa-regular fa-star"
              : "fa-regular fa-star-half-stroke"
          }
        ></i>
      </span>

      <span> {text && text} </span>
    </div>
  );
};

export default Rating;
